webpackJsonp([0xfabd740240d7],{327:function(o,e){o.exports={data:{markdownRemark:{html:"<h3>Start each meal with:</h3>\n<p>Green leafy vegetables</p>\n<p>Protein</p>\n<p>Healthy oil or fat source</p>\n<p>Add flavor (optional)</p>\n<p>Enjoy and feel good!</p>\n<p>.</p>\n<p>.</p>\n<h3>Example foods:</h3>\n<p><strong>Veggies I tend to cycle through:</strong></p>\n<p>Kale, spinach, arugula, swiss chard, collard greens, broccoli</p>\n<p><strong>Protein sources I use:</strong></p>\n<p>Chicken, Turkey, Beef, Eggs, Tuna, Salmon.  All are well sourced, meaning pasture raised, no hormones or antibiotics, if fish - wild caught.</p>\n<p><strong>Oils &#x26; fats:</strong></p>\n<p>Olive oil, coconut oil, avocado oil, avocados, avocado mayo.</p>\n<p><strong>Flavors:</strong></p>\n<p>Salt and pepper, lemon juice, coconut aminos (similar to soy sauce), vinegar, spices.</p>\n<p>.</p>\n<p>.</p>\n<h3>Tips:</h3>\n<p>Forget about eating certain foods for certain meals.  If I want eggs, I eat them for any meal.  If I have chicken and spinach cooked, I eat that for my first meal of the day.</p>\n<p>Figure out what your body does best with.  How many meals does your body need?  Snacks?  Eating window?</p>\n<p>If you’re having any kind of food difficulties, I recommend an elimination diet to find out what your body doesn’t like.</p>\n<p>Do what works for you!  <em>Ignore this completely if it doesn’t work for you.</em></p>",frontmatter:{date:"August 10, 2018",path:"/blog/simple-eating",title:"Simple Eating"}}},pathContext:{}}}});
